/* eslint-disable no-unused-vars */
import React, { useState } from "react";
import axios from 'axios';
import { Link } from 'react-router-dom';
import styles from "./Auth.module.css"; // Corrected import path
/* eslint-enable no-unused-vars */


function Authnom() {
  const [aishecode, setAishecode] = useState('');
  const [collegename, setCollegename] = useState('');
  const [state, setState] = useState('');
  const [district, setDistrict] = useState('');
  const [city, setCity] = useState('');
  const [firstname, setFirstname] = useState('');
  const [lastname, setLastname] = useState('');
  const [email, setEmail] = useState('');
  const [mobilenumber, setMobilenumber] = useState('');
  const [iic, setIic] = useState('');
  const [letter, setLetter] = useState('');
  
  const handleSubmit = (event) => {
    event.preventDefault();
    // Your form submission logic here
  };

  return (
    <>
      <div className={styles.header}>
        <h1><b>**New Users:</b> Need to enter all the data before uploading consent letter and submitting.</h1>
      </div>
      <div>
        <div className={styles.outer}>
          <form className={styles.form} method="post" onSubmit={handleSubmit}>
            <div className={styles.flex-column}>
              <label>AISHE Code</label>
            </div>
            <div className={styles.inputForm}>
              <input
                required
                placeholder="AISHE CODE"
                className={styles.input}
                type="text"
                value={aishecode}
                onChange={(e) => setAishecode(e.target.value)}
              />
              <button type="submit" className={styles.button-submit}>
                Check
              </button>
            </div>
            <div className={styles.info}>
              <p>ENTER YOUR COLLEGE AISHE CODE AND CLICK CHECK</p>
              <ul type="none">
                <li>To Know AISHE Current application Number, <a href="https://aishe.gov.in/aishe/aisheCode">click here</a></li>
              </ul>
            </div>
            <div className={styles.flex-column}>
              <label>College Name</label>
            </div>
            <div className={styles.inputForm}>
              <input
                required
                placeholder="Enter your College Name"
                className={styles.input}
                type="text"
                value={collegename}
                onChange={(e) => setCollegename(e.target.value)}
              />
            </div>
            <div className={styles.flex}>
              <div className={styles.flex-column}>
                <label>State</label>
              </div>
              <div className={styles.inputForm}>
                <input
                  required
                  placeholder="Enter your State"
                  className={styles.input}
                  type="text"
                  value={state}
                  onChange={(e) => setState(e.target.value)}
                />
              </div>
              <div className={styles.flex-column}>
                <label>District</label>
              </div>
              <div className={styles.inputForm}>
                <input
                  required
                  placeholder="Enter your District"
                  className={styles.input}
                  type="text"
                  value={district}
                  onChange={(e) => setDistrict(e.target.value)}
                />
              </div>
              <div className={styles.flex-column}>
                <label>City</label>
              </div>
              <div className={styles.inputForm}>
                <input
                  required
                  placeholder="Enter your City"
                  className={styles.input}
                  type="text"
                  value={city}
                  onChange={(e) => setCity(e.target.value)}
                />
              </div>
            </div>
            <div className={styles.flex-column}>
              <label>College Faculty First Name</label>
            </div>
            <div className={styles.inputForm}>
              <input
                required
                placeholder="Enter your first name"
                className={styles.input}
                type="text"
                value={firstname}
                onChange={(e) => setFirstname(e.target.value)}
              />
            </div>
            <div className={styles.flex-column}>
              <label>College Faculty Last Name</label>
            </div>
            <div className={styles.inputForm}>
              <input
                required
                placeholder="Enter your last name"
                className={styles.input}
                type="text"
                value={lastname}
                onChange={(e) => setLastname(e.target.value)}
              />
            </div>
            <div className={styles.flex-column}>
              <label>Email</label>
            </div>
            <div className={styles.inputForm}>
              <input
                required
                placeholder="sample@gmail.com"
                className={styles.input}
                type="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              />
            </div>
            <div className={styles.flex-column}>
              <label>Mobile No</label>
            </div>
            <div className={styles.inputForm}>
              <input
                required
                placeholder="Valid mobile number"
                className={styles.input}
                type="number"
                value={mobilenumber}
                onChange={(e) => setMobilenumber(e.target.value)}
              />
            </div>
            <div className={styles.flex-column}>
              <label>IIC Instiute Code (optional)</label>
            </div>
            <div className={styles.inputForm}>
              <input
                required
                placeholder="IIC Instiute Code"
                className={styles.input}
                type="number"
                value={iic}
                onChange={(e) => setIic(e.target.value)}
              />
            </div>
            <div className={styles.flex-column}>
              <label>Upload Consent Letter(PDF,JPG,PNG max 2MB)</label>
            </div>
            <div className={styles.inputForm}>
              <input
                required
                placeholder=""
                className={styles.input}
                type="file"
                value={letter}
                onChange={(e) => setLetter(e.target.value)}
              />
            </div>
            <div className={styles['info-1']}>
              <p>* Disclaimer: The college and school SPOC should be responsible to check each and every data before submitting. Do check the mobile number and email ID as they will be used for all future communication and verification.</p>
            </div>
          </form>
        </div>
      </div>
    </>
  );
}

export default Authnom;
